class ordenes extends Command
{
    /**
     * The name and signature of the console command.
     *
     * @var string
     */
    protected $signature = 'app:ordenes';

    /**
     * The console command description.
     *
     * @var string
     */
    protected $description = 'ejecutar ordenes';

    /**
     * Execute the console command.
     */
    public function handle(): void
    {
        Log::info('Comenzando la tarea ordenes.');
        while(true){

            Log::info('Comenzando la tarea ordenes.');
            $ordenes = OrdenAbierta::all();

            $client = new Client();

            // Realiza una petición GET a la API de Binance para obtener los precios de las criptomonedas
            $response = $client->get('https://api.binance.com/api/v3/ticker/price');

            // Decodifica la respuesta JSON en un array asociativo
            $precios = json_decode($response->getBody(), true);        

            foreach ($ordenes as $orden) {
                
                // Accede a los atributos de cada orden
                $idUsuario = $orden->id_usuario;
                $monedaPagar = $orden->monedaPagar;
                $cantidadPagar = $orden->cantidadPagar;
                $monedaRecibir = $orden->monedaRecibir;
                $precio = $orden->precio;
                $monedaComisión = $orden->monedaComisión;
                $tipoOrden = $orden->tipoOrden;
                


                // compruebo que las monedas que ha indicado existen

                $monedaPagarExiste = Coins::where('symbol', $monedaPagar)->exists();
                $monedaRecibirExiste = Coins::where('symbol', $monedaRecibir)->exists();

                if(!$monedaPagarExiste || !$monedaRecibirExiste){
                    break;
                }


                if($tipoOrden == "limite"){
                    Log::info('comprobando una orden limite');
                    $precioCambio = null;

                    $precio1 = null;
                    $precio2 = null;
        
                    if($monedaPagar == "USDT")
                        $precio1 = 1;
                    if($monedaRecibir == "USDT")
                        $precio2 = 1;

                    $simbolo1 = strtoupper($monedaPagar) . "USDT";
                    $simbolo2 = strtoupper($monedaRecibir) . "USDT";
        
                    if($precio1 === null || $precio2 === null){

                        Log::info('hay que averiguar al menos uno de los precios');
                        
                        foreach ($precios as $pr) {

                            if ($pr['symbol'] === $simbolo1) {
                                $precio1 = $pr['price'];
                            } elseif ($pr['symbol'] === $simbolo2) {
                                $precio2 = $pr['price'];
                            }
                        
                            // Si ya se han obtenido ambos precios, salimos del bucle
                            if ($precio1 !== null && $precio2 !== null)
                                break;
                        }
                        Log::info('moneda1 ' . $monedaPagar . " moneda1 2 " . $monedaRecibir );
                        Log::info('Precio1: ' . $precio1 . ' (' . gettype($precio1) . ') precio2: ' . $precio2 . ' (' . gettype($precio2) . ')');
                        
                        if ($precio1 !== null && $precio2 !== null) {
                            // Realiza la operación que necesites con los precios de PEPE y DOGE
                            $precioCambio = $precio1 / $precio2;

                            Log::info('camino ambos precios ' . $precioCambio);
                            Log::info('precios ' . print_r($precio) . ' (' . gettype($precio) . ')');

                            //si el precio es mayor o igual al indicado, se sealizan varais comprobaciones y se realiza la venta
                            if($precioCambio >= $precio){
                                Log::info('el precio es mayor o igual al indicado');

                                //obtengo el saldo del usuario en esa moneda
                                $saldo = saldo_spot::where('user_id', $idUsuario)
                                    ->where('currency', $monedaPagar)
                                    ->first();
                                
                                Log::info('El saldo es: ' . json_encode($saldo));

                                $balance = $saldo->balance;
                                $bloqueado = $saldo->bloqueado;

                                $disponible = $bloqueado;
                                
                                //esto indicaría que hay un error
