                                    Log::info('hay suficiente disponible');
                                    Log::info('saldo ' . print_r($saldo));

                                    $saldo2 = saldo_spot::where('user_id', $idUsuario)
                                    ->where('currency', $monedaRecibir)
                                    ->first();


                                    DB::transaction(function () use ($precioCambio, $monedaPagar, $balance, $cantidadPagar, $saldo, $saldo2, $idUsuario, $monedaRecibir,$precio,$orden) {
                                        $balance -= $cantidadPagar;
                                        $saldo->balance = $balance;
                                        $saldo->saldo_bloqueado = $saldo->saldo_bloqueado - $cantidadPagar;
                                    
                                        $cantidadRecibir = ($cantidadPagar * 0.997) * $precioCambio;
                                    
                                        if ($saldo2) {
                                            // El usuario ya tiene saldo en la segunda moneda, se suma la cantidad
                                            $saldo2->balance += $cantidadRecibir;
                                        } else {
                                            // El usuario no tiene saldo en la segunda moneda, se crea un nuevo registro
                                            $nuevoSaldo2 = new saldo_spot();
                                            $nuevoSaldo2->user_id = $idUsuario;
                                            $nuevoSaldo2->currency = $monedaRecibir;
                                            $nuevoSaldo2->balance = $cantidadRecibir;
                                            $nuevoSaldo2->saldo_bloqueado = 0;
                                            $nuevoSaldo2->save();
                                        }
                                        
                                        //añadirlo en la tabla de historial de ordenes y de operaciones
                                        $nuevaHistorialOrden = new historial_ordenes();
