                                        $nuevaHistorialOrden->id_usuario = $idUsuario;
                                        $nuevaHistorialOrden->monedaPagar = $monedaPagar;
                                        $nuevaHistorialOrden->cantidadPagar = $cantidadPagar;
                                        $nuevaHistorialOrden->monedaRecibir = $monedaRecibir;
                                        $nuevaHistorialOrden->cantidadRecibir = $cantidadRecibir;
                                        $nuevaHistorialOrden->precio = $precioCambio;
                                        $nuevaHistorialOrden->monedaComisión = $monedaPagar;
                                        $nuevaHistorialOrden->cantidadComisión = ($cantidadPagar * 0.003);
                                        $nuevaHistorialOrden->tipoOrden = "limite";
                                        $nuevaHistorialOrden->resultado = "completada";
                                        $nuevaHistorialOrden->save();

                                        $saldo->save();
                                        $saldo2->save();
                                        $orden->delete(); // Elimina la fila correspondiente
                                    });
                                }
                                
                            }

                        }
                    }
                }
                else if($tipoOrden == "mercado"){
                    Log::info('Orden a mercado');
                    $pareja = $this->checkTradingPair($monedaPagar,$monedaRecibir);
                    if($pareja === false){
                        Log::info('No se han encontrado las monedas');
                        $this->cancelar_orden($orden->id,"par de monedas no encontrado","mercado");
                    }
                    else if($pareja == "separado"){
                        Log::info('se calculan los precios por separado');
                        //calcular precio
                        $precioCambio = null;
                        $precio1 = null;
                        $precio2 = null;

                        $simbolo1 = strtoupper($monedaPagar) . "USDT";
                        $simbolo2 = strtoupper($monedaRecibir) . "USDT";
            
                            
                        foreach ($precios as $pr) {

                            if ($pr['symbol'] === $simbolo1) {
