                        if ($precio1 !== null && $precio2 !== null) {
                            $precioCambio = $precio1 / $precio2;

                            //obtengo el saldo del usuario en esa moneda
                            $saldo = saldo_spot::where('user_id', $idUsuario)
                                ->where('currency', $monedaPagar)
