                            Log::info('El saldo es: ' . json_encode($saldo));

                            $disponible = $saldo->balance - $saldo->bloqueado;

                            //comprobamos que el usuario tenga suficiente saldo en esa moneda
                            if($disponible >= $cantidadPagar){
                                Log::info('saldo ' . print_r($saldo));

                                $saldo2 = saldo_spot::where('user_id', $idUsuario)
                                ->where('currency', $monedaRecibir)
                                ->first();

                                DB::beginTransaction();
                                // DB::transaction(function () use ($precioCambio, $monedaPagar, $disponible, $cantidadPagar, $saldo, $saldo2, $idUsuario, $monedaRecibir,$orden,$pareja) {
                                $disponible -= $cantidadPagar;
                                $saldo->balance = $disponible;
                            
                                $cantidadRecibir = ($cantidadPagar * 0.997) * $precioCambio;
                            
                                if ($saldo2) {
                                    // El usuario ya tiene saldo en la segunda moneda, se suma la cantidad
                                    $saldo2->balance += $cantidadRecibir;
                                } else {
                                    // El usuario no tiene saldo en la segunda moneda, se crea un nuevo registro
                                    $nuevoSaldo2 = new saldo_spot();
                                    $nuevoSaldo2->user_id = $idUsuario;
                                    $nuevoSaldo2->currency = $monedaRecibir;
                                    $nuevoSaldo2->balance = $cantidadRecibir;
                                    $nuevoSaldo2->saldo_bloqueado = 0;
                                    $nuevoSaldo2->save();
                                }
                                
                                //añadirlo en la tabla de historial de ordenes y de operaciones
                                $nuevaHistorialOrden = new historial_ordenes();
                                $nuevaHistorialOrden->id_orden = $orden->id;
                                $nuevaHistorialOrden->id_usuario = $idUsuario;
                                $nuevaHistorialOrden->monedaPagar = $monedaPagar;
                                $nuevaHistorialOrden->cantidadPagar = $cantidadPagar;
                                $nuevaHistorialOrden->monedaRecibir = $monedaRecibir;
                                $nuevaHistorialOrden->cantidadRecibir = $cantidadRecibir;
                                $nuevaHistorialOrden->precio = $precioCambio;
                                $nuevaHistorialOrden->monedaComisión = $monedaPagar;
                                $nuevaHistorialOrden->cantidadComisión = ($cantidadPagar * 0.003);
                                $nuevaHistorialOrden->tipoOrden = "mercado";
                                $nuevaHistorialOrden->resultado = "completada";
                                $nuevaHistorialOrden->save();

                                $saldo->save();
                                $saldo2->save();
                                $orden->delete(); // Elimina la fila correspondiente

                                $cantidadRecibirSinComision = $cantidadPagar * $precioCambio;
                                
                                $comprado = false;
                                $vendido = false;

                                $sePuedeVender = $this->limites(strtoupper($monedaPagar) . 'USDT',$cantidadPagar);
                                $sePuedeComprar = $this->limites(strtoupper($monedaRecibir) . 'USDT',$cantidadRecibirSinComision);

                                if($sePuedeVender !== false){
                                    $vendido = $this->createMarketOrder($monedaPagar, 'USDT', $cantidadPagar, 'SELL', $sePuedeVender);
                                }
                                if($sePuedeComprar !== false){
                                    $comprado = $this->createMarketOrder($monedaRecibir, 'USDT', $cantidadRecibirSinComision, 'BUY',$sePuedeComprar);
                                }

                                
                                //si únicamente se hace una de las dos, se anota en una base de datos cuál no se ha hecho y luego 
                                // la hago
                                if(!$vendido && $comprado){
                                    transacciones_fallidas::create([
                                        'transaction_id' => $orden->id,
                                        'moneda1' => $monedaPagar,
                                        'moneda2' => 'USDT',
                                        'cantidad_pagar' => $cantidadPagar,
                                        'tipo' => 'SELL',
                                        'motivo' => '', // Puede ser nulo si no se proporciona
                                    ]);
                                }
                                if($vendido && !$comprado){
                                    try{
                                        transacciones_fallidas::create([
                                            'transaction_id' => $orden->id,
                                            'moneda1' => $monedaRecibir,
                                            'moneda2' => 'USDT',
                                            'cantidad_pagar' => $cantidadRecibirSinComision,
                                            'tipo' => 'BUY',
                                            'motivo' => '', // Puede ser nulo si no se proporciona
                                        ]);
                                    }catch(\Exception $e){

                                    }
                                }
                                if($comprado){
                                    DB::commit();
                                }
                                else{
                                    DB::rollBack();
                                }
                            }
