                        }
                        Log::info('El simbolo es: ' . $simbolo);
                        $precioComprar = null;
                        foreach ($precios as $pr) {
                            if ($pr['symbol'] === $simbolo) 
                                $precioComprar = $pr['price'];    
                            
                            if ($precioComprar !== null)
