                                // DB::transaction(function () use ($precioComprar, $monedaPagar, $disponible, $cantidadPagar, $saldoPagarCompra, $saldoRecibirCompra, $idUsuario, $monedaRecibir,$orden) {
                                DB::beginTransaction();
                                Log::info('comienza la transaccion');
                                $disponible -= $cantidadPagar;
                                $saldoPagarCompra->balance = $disponible;
                                $cantidadRecibirSinComision = null;
                            
                                if($pareja == "comprar"){
                                    $cantidadRecibir = ($cantidadPagar * 0.997) * $precioComprar;
                                    $cantidadRecibirSinComision = $cantidadPagar * $precioComprar;
                                }
                                else if($pareja == "vender"){
                                    $cantidadRecibir = ($cantidadPagar / $precioComprar) * 0.997;
                                    $cantidadRecibirSinComision = $cantidadPagar / $precioComprar;
                                }

                                

                                Log::info("Cantidad a recibir: " . $cantidadRecibir . " en " . $monedaRecibir . " y pagar " . $cantidadPagar . " en " . $monedaPagar);
                            
                                if ($saldoRecibirCompra) {
                                    // El usuario ya tiene saldo en la segunda moneda, se suma la cantidad
                                    $saldoRecibirCompra->balance += $cantidadRecibir;
                                    $saldoRecibirCompra->save();
                                    Log::info('se guarda el sumento de saldo');
                                } else {
                                    // El usuario no tiene saldo en la segunda moneda, se crea un nuevo registro
                                    $nuevoSaldo2 = new saldo_spot();
                                    $nuevoSaldo2->user_id = $idUsuario;
                                    $nuevoSaldo2->currency = $monedaRecibir;
                                    $nuevoSaldo2->balance = $cantidadRecibir;
                                    $nuevoSaldo2->saldo_bloqueado = 0;
                                    $nuevoSaldo2->save();
                                    Log::info('se guarda el saldo');
                                }
                                
                                //añadirlo en la tabla de historial de ordenes y de operaciones
                                $nuevaHistorialOrden = new historial_ordenes();
                                $nuevaHistorialOrden->id_orden = $orden->id;
                                $nuevaHistorialOrden->id_usuario = $idUsuario;
                                $nuevaHistorialOrden->monedaPagar = $monedaPagar;
                                $nuevaHistorialOrden->cantidadPagar = $cantidadPagar;
                                $nuevaHistorialOrden->monedaRecibir = $monedaRecibir;
                                $nuevaHistorialOrden->cantidadRecibir = $cantidadRecibir;
                                $nuevaHistorialOrden->precio = $precioComprar;
                                $nuevaHistorialOrden->monedaComisión = $monedaPagar;
                                $nuevaHistorialOrden->cantidadComisión = ($cantidadPagar * 0.003);
                                $nuevaHistorialOrden->tipoOrden = "mercado";
                                $nuevaHistorialOrden->resultado = "completada";
                                $nuevaHistorialOrden->save();
                                Log::info('la nueva orden se guarda');

                                $saldoPagarCompra->save();
                                Log::info('la reduccion de saldo se guarda');
                                // $saldoPagarCompra->save();
                                $orden->delete(); // Elimina la fila correspondiente
                                Log::info('el borrado de la fila se guarda');
                                
                                $ejecutado = false;

                                if($pareja == 'comprar'){
                                    Log::info('se compra en binance');
                                    $sePuedeComprar = $this->limites(strtoupper($monedaPagar) . strtoupper($monedaRecibir),$cantidadPagar);
                                    if($sePuedeComprar !== false){
                                        $ejecutado = $this->createMarketOrder($monedaPagar, $monedaRecibir, $cantidadPagar, 'SELL', $sePuedeComprar);
                                    }
                                }
                                else if($pareja == 'vender'){
                                    Log::info('se vende en binance');
                                    $sePuedeVender = $this->limites(strtoupper($monedaRecibir) . strtoupper($monedaPagar),$cantidadPagar);
                                    if($sePuedeVender !== false){
                                        $ejecutado = $this->createMarketOrder($monedaRecibir, $monedaPagar, $cantidadRecibirSinComision, 'BUY',$sePuedeVender);
                                    }
                                }
                                if($ejecutado === true){
                                    Log::info('se ejecuta la transaccion');
                                    DB::commit();
                                }
                                else{
                                    Log::info("motivo por el que no se ha ejecutado " . $ejecutado);
                                    try{
                                        if($pareja == "comprar"){
                                            transacciones_fallidas::create([
                                                'transaction_id' => $orden->id,
