                                                'moneda2' => $monedaRecibir,
                                                'cantidad_pagar' => $cantidadPagar,
                                                'tipo' => 'SELL',
                                                'motivo' => $ejecutado, // Puede ser nulo si no se proporciona
                                            ]);
                                        }
                                        else if($pareja == "vender"){
                                            transacciones_fallidas::create([
                                                'transaction_id' => $orden->id,
                                                'moneda1' => $monedaRecibir,
                                                'moneda2' => $monedaPagar,
                                                'cantidad_pagar' => $cantidadPagar,
                                                'tipo' => 'BUY',
                                                'motivo' => $ejecutado, // Puede ser nulo si no se proporciona
                                            ]);
                                        }
                                    } catch(\Exception $e){

                                    }
                                    Log::info('se deshace la transaccion');
                                    DB::rollBack();
                                }
                            }
                        }
                        else{
                            $this->cancelar_orden($orden->id,"no se han encontrado los precios","mercado");
                        }
                    }
                }
            }
            Log::info('fin');
            sleep(3);
        }
    }

    public function createMarketOrder($arriba, $abajo, $cantidad, $side,$precision){

        $apiKey = 'dNxsZ5r3R9yJudQkGsQXRufd8teAW7xvLsNJwBYTOmBNEBmwW9B4WwPJ0cLr2l0w';
        $apiSecret = 'jbqylpFXUCh9gQUoQijXCJV2vJ57uKiwCPk7s8RVanSDDxZrszmQjedpbeJiG8uh';

        $client = new Client();

        $timestamp = time() * 1000;
        $recvWindow = 5000;
        $symbol = strtoupper($arriba) . strtoupper($abajo); // Símbolo de trading 
        $side = $side; // (BUY o SELL)
        $type = 'MARKET'; // Orden de tipo mercado
        $quantity = round($cantidad, $precision); // Cantidad a comprar

        $params = [
            'symbol' => $symbol,
            'side' => $side,
            'type' => $type,
            'quantity' => $quantity,
            'timestamp' => $timestamp,
            'recvWindow' => $recvWindow,
        ];
        Log::info('Intentando comprar ' . $quantity . ' de ' . $symbol);
        // Crear la cadena de consulta para la firma HMAC
        $queryString = http_build_query($params);

        // Generar la firma HMAC
        $signature = hash_hmac('sha256', $queryString, $apiSecret);
        try {
            $response = $client->post('https://testnet.binance.vision/api/v3/order', [
                'headers' => [
                    'X-MBX-APIKEY' => $apiKey,
                ],
                'form_params' => array_merge($params, ['signature' => $signature]),
            ]);

            $data = json_decode($response->getBody(), true);

            if (isset($data['status']) && $data['status'] === 'FILLED' || $data['status'] === 'NEW' || $data['status'] === 'PARTIALLY_FILLED') {
                Log::info("se ha realizado la transaccion");
                return true;
            } else {
                Log::info("No se ha realizado la transaccion" . $data['status']);
                return $data['status'];
            }
        } catch (\Exception $e) {
            Log::info($e->getMessage());
            return $e->getMessage();
        }
    }

